(596, 140, 'menegers_0_meneger', '<img class="size-full wp-image-145 alignleft" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/image.jpg" alt="" width="199" height="211" />\r\n<h4>General Manager\r\n<strong>Santiago Jarrin</strong></h4>\r\nA graduate of the school of Commercial Engineering and Business Administration &amp; Marketing, my extensive experience includes 20 years in the printing industry. I am very pleased to contribute my skills and knowledge to the success of FGS. As General Manager, and responsible for production, operations, marketing and sales, I have the satisfaction of working with a passion and philosophy of unmatched service towards our customers, which has resulted in an extensive client base. We are very proud to be part of our clients’ success.'),
(597, 140, '_menegers_0_meneger', 'field_5a4130e0b0c6a'),
(598, 140, 'menegers_1_meneger', '<img class="size-full wp-image-144 alignleft" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-33.jpg" alt="" width="199" height="206" />\r\n<h4>Office Manager\r\n<strong>Lorena Cabezas</strong></h4>\r\nResponsible for prepress, customer service and sales, Ms. Cabezas is a graduate at The University of Texas in Austin, and holds a degree in Business administration &amp; Marketing. Lorena has over 18 years of experience in the digital print industry as well as an extensive knowledge of product design, organization and management, financial control and accounting.\r\n\r\nShe is responsible for a team of employees dedicated to maintaining clear and continuous communications with FGS customers in order to deliver high quality products and services. She is a strong believer of the company’s philosophy that exceptional service is built on the skills, expertise, and a positive attitude of its employees.base. We are very proud to be part of our clients’ success.'),
(599, 140, '_menegers_1_meneger', 'field_5a4130e0b0c6a'),
