(680, 140, 'section_1', '<h4>Customer Service <strong>team</strong></h4>\r\n<img class="alignleft wp-image-193" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-34-300x148.jpg" alt="" width="650" height="320" />Our knowledgeable team of customer service professionals are always ready to help make your job as seamless as possible. They monitor your project through every step of the production process to make sure that it is done correctly and consistently on time. Always friendly and patient, our customer service team will have the answers to your questions and the information that you need so that your experience with Florida Graphic Services will be rewarding and profitable. Please contact one of our representatives today and experience for yourself the outstanding service we provide at FGS.\r\n[phone][/phone]'),
(681, 140, '_section_1', 'field_5a42043d70f51'),
(682, 140, 'section_2', '<h4>Prepress/Graphic Design <strong>Team</strong></h4>\r\n<img class="alignleft wp-image-194" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-35-300x188.jpg" alt="" width="650" height="407" />Let our experienced and friendly graphic design team help you create the best product possible. Prepress works hand in hand with customer service as well as our production team to ensure that all artwork is set up properly according to materials, specifications and printing methods. They are highly trained in accurate color management and have the ability to adjust files and retouch when necessary. Custom artwork or concept design is also at your disposal should you need it, and we are experienced at creating prototypes.Our prepress department has what it takes to make your images pop!'),
