(718, 58, 'content', '<h3>File Submission Specs</h3>\r\nThe specifications below must be followed when submitting a file to print. Failure to follow the specifications will result in a delay in the completion of submitted job. If you are not able to provide a file following the submission specs, our Prepress Department will fix your file at a rate of $50/hr. An estimate will be given before the fix is started and is dependent on the complexity of the fix. The client must give approval before any work is started by the Prepress Department.\r\n<ul>\r\n 	<li>All fonts must be outlined or included with the file</li>\r\n 	<li>Include all linked files if necessary</li>\r\n 	<li>Any raster graphics must be at least 100 dpi when viewed at full size or 100%</li>\r\n 	<li>Art must be sent in a timely fashion to resolve any issues that may arise during the prepress process.</li>\r\n 	<li>Any PMS or Spot Colors that need to be matched should be identified and brought to the attention of the CSR when requesting a estimate or placing an order.</li>\r\n 	<li>All files must be submitted as CYMK; any files submitted in any other color mode will be converted to CYMK. We suggest doing this conversion yourself before submitting because slight color shifting may occur when changing color mode.</li>\r\n 	<li>All files submitted must be in a file format accepted below.</li>\r\n 	<li>Acceptable File Formats: PDF, EPS, TIFF, AI, PSD, INDD or a High Resolution, Maximum Quality JPEG</li>\r\n 	<li>All files under 10MB can be submitted via e-mail. Any files larger than 10MB must be submitted via FTP, large file transfer service (Hightail.com, Wetransfer.com), CD, or USB drive.</li>\r\n</ul>'),
