(1381, 304, 'description', '<ul>\r\n 	<li>Foamboard is used when a rigid light weight substrate is needed. It is perfect for creating standees when paired with an easel or similar hardware. It is also easily wall mountable with the use of french cleats or a strong double sided adhesive. It can be either direct printed or vinyl mounted depending on the use and the mounting location of the product. It can be routed into custom shapes and is available in different thicknesses.</li>\r\n 	<li>Technical Specs: Type: Gatorboard, Ultraboard, Foamboard; Color: White, black; Size: 48″ x 96″, 60″ x 120″(call for availability); Thickness: Call for availability:1/2″, 3/16″, 3/4″</li>\r\n 	<li>Applications: Interior Design, Fine Art Reproduction, POP/POS, Exhibit &amp; Displays</li>\r\n 	<li>Products: Posters, Standees, Dimensional Signs</li>\r\n</ul>'),
