(1396, 315, 'description', '<ul>\r\n 	<li>Aluminum Composite is a lightweight rigid substrate that is intended for long-term outdoor use. It is composed of two sheets of aluminum sandwiching a polyethylene core, making it light enough to hang safely and provide durable product. Its properties make it perfect for wayfinding signs and areas that experience heavy traffic. When paired with our Nature Proofing system, its product life can last up to 5 years under normal conditions.</li>\r\n 	<li>Technical Specs: Type: Alumacore, Aluminum Composite, Diebond® available upon request; Size: 48″ x 96″, 60″ x 120″(call for availability); Thickness: 1/2″, 1/4″, 1/8″, 3/16″</li>\r\n 	<li>Applications: Architectural, Interior Design, Outdoor Signage, POP/POS, Theme Park, Exhibit &amp; Displays, Storefront Signage</li>\r\n 	<li>Products: Political Signs, Dimensional Signs, Construction Site Signs</li>\r\n</ul>'),
(1397, 315, '_description', 'field_5a43b52e4f3a2'),
(1398, 316, 'description', '<ul>\r\n 	<li>Aluminum Composite is a lightweight rigid substrate that is intended for long-term outdoor use. It is composed of two sheets of aluminum sandwiching a polyethylene core, making it light enough to hang safely and provide durable product. Its properties make it perfect for wayfinding signs and areas that experience heavy traffic. When paired with our Nature Proofing system, its product life can last up to 5 years under normal conditions.</li>\r\n</ul>'),
