(1402, 317, '_thumbnail_id', '305'),
(1403, 317, 'description', '<ul>\r\n 	<li>Aluminum is mainly used when an outdoor long term use product is needed. It is able to be routed and bent into custom shapes and can be ordered in custom sizes. When paired with our Nature Proofing system we are able to direct print to the surface and produce a product that can last up to 5 years under normal conditions.</li>\r\n 	<li>Technical Specs: Size: 48″ x 96″, 24″ x 18″(available only in 024), Custom sizes and shapes are available; Thickness: 040, 060, 080, 1/8″, 024(available only in 24″ x 18″ blanks)</li>\r\n 	<li>Applications: Architectural, Interior Design, Outdoor Signage, Theme Park, Exhibit &amp; Displays, Storefront Signage</li>\r\n 	<li>Products: Powder Coat Signs, Wall Graphics, Dimensional Signs</li>\r\n</ul>'),
(1404, 317, '_description', 'field_5a43b52e4f3a2'),
