(1409, 319, '_thumbnail_id', '306'),
(1410, 319, 'description', '<ul>\r\n 	<li>Acrylic is a versatile substrate; it can be used indoors as well as outdoors. It can easily be routed into custom shapes to fit into any frame or concept. The graphic must be vinyl mounted due to the substrate’s properties. It performs will in backlit situations when paired with white ink. Use acrylic when you want to produce a high end display or when backlighting is needed.</li>\r\n 	<li>Technical Specs: Type: Clear, Non-Glare, White; Size: 48″ x 96″, 60″ x 120″(call for availability); Thickness: Clear: 1/16″, 3/16″, 1/8″, 1/4″, 1/2″, 1″; Non-Glare: 1/16″, 1/8″, 1/4″; White: 3/16″, 1/8″, 1/4″ 1/2″</li>\r\n 	<li>Applications: Architectural, Interior Design, Fine Art Reproduction, Outdoor Signage, POP/POS, Theme Park, Exhibit &amp; Displays</li>\r\n</ul>'),
(1411, 319, '_description', 'field_5a43b52e4f3a2'),
