(1687, 50, 'services_6_content', 'Small jobs or big projects, individual packing or kit packing; at FGS, we don’t just wrap your signs, we care about our customers and take personal responsibility to pack the job in the best method necessary to allow the materials to arrive safely and in perfect condition every time.  If shipping is needed we will coordinate your shipment with UPS, FedEX, or courier at the priority level you need.  We can ship to anywhere in the U.S. or internationally.'),
