(1927, 369, 'description', '<ul>\r\n 	<li>Acrylic is a versatile substrate; it can be used indoors as well as outdoors. It can easily be routed into custom shapes to fit into any frame or concept. The graphic must be vinyl mounted due to the substrate’s properties. It performs will in backlit situations when paired with white ink. Use acrylic when you want to produce a high end display or when backlighting is needed.</li>\r\n</ul>'),
