(1933, 370, 'description', '<ul>\r\n 	<li>Aluminum is mainly used when an outdoor long term use product is needed. It is able to be routed and bent into custom shapes and can be ordered in custom sizes. When paired with our Nature Proofing system we are able to direct print to the surface and produce a product that can last up to 5 years under normal conditions.</li>\r\n</ul>'),
(1934, 370, '_description', 'field_5a43b52e4f3a2'),
