(1939, 371, 'description', '<ul>\r\n 	<li>Aluminum Composite is a lightweight rigid substrate that is intended for long-term outdoor use. It is composed of two sheets of aluminum sandwiching a polyethylene core, making it light enough to hang safely and provide durable product. Its properties make it perfect for wayfinding signs and areas that experience heavy traffic. When paired with our Nature Proofing system, its product life can last up to 5 years under normal conditions.</li>\r\n</ul>'),
