(1991, 384, 'description', '<ul>\r\n 	<li>Corrugated Plastic is used for single use to short-term applications. It can be routed into custom shapes to meet your needs. It is typically direct printed and can be installed into signacades for sidewalk sign applications or stepstakes for road side applications.</li>\r\n</ul>'),
