(1997, 385, 'description', '<ul>\r\n 	<li>Foamboard is used when a rigid light weight substrate is needed. It is perfect for creating standees when paired with an easel or similar hardware. It is also easily wall mountable with the use of french cleats or a strong double sided adhesive. It can be either direct printed or vinyl mounted depending on the use and the mounting location of the product. It can be routed into custom shapes and is available in different thicknesses.</li>\r\n</ul>'),
