(2407, 442, '_services_4_title', 'field_5a451e39d1e9b'),
(2408, 442, 'services_4_content', 'Expand your product line and services by offering precision routing solid substrates. FGS offers the latest technology on our flatbed routers to accomplish your needs with precision routing from basic to complex shapes.  Max thickness: 2″ depending on substrate.  Max size: 5′ x 10′ depending on substrate.'),
(2409, 442, '_services_4_content', 'field_5a451e48d1e9c'),
