(2414, 442, 'services_5_title', 'Finishing'),
(2415, 442, '_services_5_title', 'field_5a451e39d1e9b'),
(2416, 442, 'services_5_content', 'You printed your client’s banner, but what do you do when your client’s job needs more than just printing. Our full service sewing department finishes your banners and graphics to exact specifications with precision technology.'),
(2417, 442, '_services_5_content', 'field_5a451e48d1e9c'),
(2418, 442, 'services_5_image', '357'),
(2419, 442, '_services_5_image', 'field_5a451e54d1e9d'),
(2420, 442, 'services_6_title', 'Fulfillment'),
(2421, 442, '_services_6_title', 'field_5a451e39d1e9b'),
(2422, 442, 'services_6_content', 'Small jobs or big projects, individual packing or kit packing; at FGS, we don’t just wrap your signs, we care about our customers and take personal responsibility to pack the job in the best method necessary to allow the materials to arrive safely and in perfect condition every time.  If shipping is needed we will coordinate your shipment with UPS, FedEX, or courier at the priority level you need.  We can ship to anywhere in the U.S. or internationally.'),
(2423, 442, '_services_6_content', 'field_5a451e48d1e9c'),
