(2634, 498, 'description', '<ul>\r\n 	<li>PVC is a durable and versatile substrate. Perfect for direct printing and routing into custom shapes. It performs well outdoors when paired with liquid lamination. It is available in different thicknesses and colors.</li>\r\n 	<li>Technical Specs: Color: White and Black readily available, all other colors must be special ordered; Size: 48″ x 96″, 60″ x 120″(call for availability); Thickness: 1/8″, 1/4″, 1/2″ readily available, all other thicknesses must be special ordered</li>\r\n 	<li>Applications: Architectural, Outdoor Signage, POP/POS, Event Signage, Theme Park, Exhibit &amp; Displays, Storefront Signage</li>\r\n 	<li>Products: Sidewalk Signs, Hanging Exhibit Graphics, Golf Tournament Signs, Political Signs, Dimensional Signs, Construction Site Signs</li>\r\n</ul>'),
