(3643, 834, 'menegers_0_meneger', '<img class="size-full wp-image-145 alignleft" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/image.jpg" alt="" width="199" height="211" />\r\n<h4>General Manager\r\n<strong>Santiago Jarrin</strong></h4>\r\nA graduate of the school of Commercial Engineering and Business Administration &amp; Marketing, my extensive experience includes 20 years in the printing industry. I am very pleased to contribute my skills and knowledge to the success of FGS. As General Manager, and responsible for production, operations, marketing and sales, I have the satisfaction of working with a passion and philosophy of unmatched service towards our customers, which has resulted in an extensive client base. We are very proud to be part of our clients’ success.'),
(3644, 834, '_menegers_0_meneger', 'field_5a4130e0b0c6a'),
(3645, 834, 'menegers_1_meneger', '<img class="size-full wp-image-144 alignleft" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-33.jpg" alt="" width="199" height="206" />\r\n<h4>Office Manager\r\n<strong>Lorena Cabezas</strong></h4>\r\nResponsible for prepress, customer service and sales, Ms. Cabezas is a graduate at The University of Texas in Austin, and holds a degree in Business administration &amp; Marketing. Lorena has over 18 years of experience in the digital print industry as well as an extensive knowledge of product design, organization and management, financial control and accounting.\r\n\r\nShe is responsible for a team of employees dedicated to maintaining clear and continuous communications with FGS customers in order to deliver high quality products and services. She is a strong believer of the company’s philosophy that exceptional service is built on the skills, expertise, and a positive attitude of its employees.base. We are very proud to be part of our clients’ success.'),
(3646, 834, '_menegers_1_meneger', 'field_5a4130e0b0c6a'),
(3647, 834, 'menegers', '2'),
(3648, 834, '_menegers', 'field_5a4130cab0c69'),
(3649, 834, 'section_1', '<h4>Customer Service <strong>team</strong></h4>\r\n<img class="alignleft wp-image-193" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-34-300x148.jpg" alt="" width="650" height="320" />Our knowledgeable team of customer service professionals are always ready to help make your job as seamless as possible. They monitor your project through every step of the production process to make sure that it is done correctly and consistently on time. Always friendly and patient, our customer service team will have the answers to your questions and the information that you need so that your experience with Florida Graphic Services will be rewarding and profitable. Please contact one of our representatives today and experience for yourself the outstanding service we provide at FGS.\r\n[phone][/phone]'),
(3650, 834, '_section_1', 'field_5a42043d70f51'),
(3651, 834, 'section_2', '<h4>Prepress/Graphic Design Team</h4>\r\n<img class="alignleft wp-image-194" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-35-300x188.jpg" alt="" width="650" height="407" />Let our experienced and friendly graphic design team help you create the best product possible. Prepress works hand in hand with customer service as well as our production team to ensure that all artwork is set up properly according to materials, specifications and printing methods. They are highly trained in accurate color management and have the ability to adjust files and retouch when necessary. Custom artwork or concept design is also at your disposal should you need it, and we are experienced at creating prototypes.Our prepress department has what it takes to make your images pop!'),
(3652, 834, '_section_2', 'field_5a42044570f52'),
(3653, 835, 'menegers_0_meneger', '<img class="size-full wp-image-145 alignleft" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/image.jpg" alt="" width="199" height="211" />\r\n<h4>General Manager\r\n<strong>Santiago Jarrin</strong></h4>\r\nA graduate of the school of Commercial Engineering and Business Administration &amp; Marketing, my extensive experience includes 20 years in the printing industry. I am very pleased to contribute my skills and knowledge to the success of FGS. As General Manager, and responsible for production, operations, marketing and sales, I have the satisfaction of working with a passion and philosophy of unmatched service towards our customers, which has resulted in an extensive client base. We are very proud to be part of our clients’ success.'),
(3654, 835, '_menegers_0_meneger', 'field_5a4130e0b0c6a'),
(3655, 835, 'menegers_1_meneger', '<img class="size-full wp-image-144 alignleft" src="http://do.ready-for-feedback.com/561-media/fgs/wp-content/uploads/2017/12/Layer-33.jpg" alt="" width="199" height="206" />\r\n<h4>Office Manager\r\n<strong>Lorena Cabezas</strong></h4>\r\nResponsible for prepress, customer service and sales, Ms. Cabezas is a graduate at The University of Texas in Austin, and holds a degree in Business administration &amp; Marketing. Lorena has over 18 years of experience in the digital print industry as well as an extensive knowledge of product design, organization and management, financial control and accounting.\r\n\r\nShe is responsible for a team of employees dedicated to maintaining clear and continuous communications with FGS customers in order to deliver high quality products and services. She is a strong believer of the company’s philosophy that exceptional service is built on the skills, expertise, and a positive attitude of its employees.base. We are very proud to be part of our clients’ success.'),
