(3676, 838, 'faqs_0_question', 'What is the minimum order fee?'),
(3677, 838, '_faqs_0_question', 'field_5a423f3f54585'),
(3678, 838, 'faqs_0_answer', 'All orders placed with FGS must meet a $100 minimum order.  Any order not meeting the $100 minimum order will be quoted at $100.'),
(3679, 838, '_faqs_0_answer', 'field_5a423f2454584'),
(3680, 838, 'faqs_1_question', 'What is your standard turnaround time?'),
(3681, 838, '_faqs_1_question', 'field_5a423f3f54585'),
(3682, 838, 'faqs_1_answer', 'The current standard turnaround time is 5 business days from the date the CSR receives the approval of the proof.'),
(3683, 838, '_faqs_1_answer', 'field_5a423f2454584'),
(3684, 838, 'faqs_2_question', 'How long does it take you to complete a job?'),
(3685, 838, '_faqs_2_question', 'field_5a423f3f54585'),
(3686, 838, 'faqs_2_answer', 'The completion of a job depends on the complexity and quantity of the job.  Most jobs will be completed in the standard 5 business days from the receipt of the approval of proof.  Your CSR will notify of any job that will require longer than the standard 5 day turnaround.'),
(3687, 838, '_faqs_2_answer', 'field_5a423f2454584'),
(3688, 838, 'faqs_3_question', 'Do you have rush fees?'),
(3689, 838, '_faqs_3_question', 'field_5a423f3f54585'),
(3690, 838, 'faqs_3_answer', 'Yes, any job needed before the standard 5 day turnaround from approval of proof is subject to rush fees. Fees are as follows:\r\nNext day turnaround the fee is 35% of the total value of the job.\r\n2 day turnaround the fee is 25% of the total value of the job.\r\n3 day turnaround the fee is 15% of the total value of the job.\r\n4 day turnaround the fee is 10% of the total value of the job.'),
(3691, 838, '_faqs_3_answer', 'field_5a423f2454584'),
(3692, 838, 'faqs_4_question', 'What is the square footage price for a print?'),
(3693, 838, '_faqs_4_question', 'field_5a423f3f54585'),
(3694, 838, 'faqs_4_answer', 'FGS does not have a standard sqft price for the majority of its products; the exception being standard banners. The rest of the products are priced on an individual job basis. The main three variables that go into pricing a job are:\r\nUtilization – This is determined on how much waste will be left over after the job is complete. The better the utilization, the lower the waste, which means a lower sqft price.\r\nComplexity of finishing and printing – The more complex the job, the more time will be needed to complete the job. More time means a higher sqft price.\r\nVolume of job – The higher the volume ordered will result in a lower sqft price.'),
(3695, 838, '_faqs_4_answer', 'field_5a423f2454584'),
(3696, 838, 'faqs_5_question', 'what file types do you accpet for the submission of art?'),
(3697, 838, '_faqs_5_question', 'field_5a423f3f54585'),
