(3724, 840, 'content', ''),
(3725, 840, '_content', 'field_5a4219e01d3d0'),
(3726, 840, 'faqs_0_question', 'What is the minimum order fee?'),
(3727, 840, '_faqs_0_question', 'field_5a423f3f54585'),
(3728, 840, 'faqs_0_answer', 'All orders placed with FGS must meet a $100 minimum order. Any order not meeting the $100 minimum order will be quoted at $100.'),
(3729, 840, '_faqs_0_answer', 'field_5a423f2454584'),
(3730, 840, 'faqs_1_question', 'What is your standard turnaround time?'),
(3731, 840, '_faqs_1_question', 'field_5a423f3f54585'),
(3732, 840, 'faqs_1_answer', 'The current standard turnaround time is 5 business days from the date the CSR receives the approval of the proof.'),
(3733, 840, '_faqs_1_answer', 'field_5a423f2454584'),
(3734, 840, 'faqs_2_question', 'How long does it take you to complete a job?'),
(3735, 840, '_faqs_2_question', 'field_5a423f3f54585'),
(3736, 840, 'faqs_2_answer', 'The completion of a job depends on the complexity and quantity of the job. Most jobs will be completed in the standard 5 business days from the receipt of the approval of proof. Your CSR will notify of any job that will require longer than the standard 5 day turnaround.'),
(3737, 840, '_faqs_2_answer', 'field_5a423f2454584'),
(3738, 840, 'faqs_3_question', 'Do you have rush fees?'),
(3739, 840, '_faqs_3_question', 'field_5a423f3f54585'),
(3740, 840, 'faqs_3_answer', 'Yes, any job needed before the standard 5 day turnaround from approval of proof is subject to rush fees. Fees are as follows:\r\nNext day turnaround the fee is 35% of the total value of the job.\r\n2 day turnaround the fee is 25% of the total value of the job.\r\n3 day turnaround the fee is 15% of the total value of the job.\r\n4 day turnaround the fee is 10% of the total value of the job.'),
(3741, 840, '_faqs_3_answer', 'field_5a423f2454584'),
(3742, 840, 'faqs_4_question', 'What is the square footage price for a print?'),
(3743, 840, '_faqs_4_question', 'field_5a423f3f54585'),
(3744, 840, 'faqs_4_answer', 'FGS does not have a standard sqft price for the majority of its products; the exception being standard banners. The rest of the products are priced on an individual job basis. The main three variables that go into pricing a job are:\r\n<ul>\r\n 	<li>Utilization – This is determined on how much waste will be left over after the job is complete. The better the utilization, the lower the waste, which means a lower sqft price.</li>\r\n 	<li>Complexity of finishing and printing – The more complex the job, the more time will be needed to complete the job. More time means a higher sqft price.</li>\r\n 	<li>Volume of job – The higher the volume ordered will result in a lower sqft price.</li>\r\n</ul>'),
(3745, 840, '_faqs_4_answer', 'field_5a423f2454584'),
(3746, 840, 'faqs_5_question', 'what file types do you accpet for the submission of art?'),
(3747, 840, '_faqs_5_question', 'field_5a423f3f54585'),
(3748, 840, 'faqs_5_answer', 'We accept: PDF, EPS, TIFF, AI, PSD, INDD or a High Resolution, Maximum Quality JPEG.\r\n\r\n<a href="http://do.ready-for-feedback.com/561-media/fgs/resources/">Click here for complete file submission specs</a>'),
(3749, 840, '_faqs_5_answer', 'field_5a423f2454584'),
(3750, 840, 'faqs_6_question', 'How long does FGS honor the given price on an estimate?'),
(3751, 840, '_faqs_6_question', 'field_5a423f3f54585'),
(3752, 840, 'faqs_6_answer', 'We will honor an estimate 30 days from the date the estimate was created.'),
(3753, 840, '_faqs_6_answer', 'field_5a423f2454584'),
(3754, 840, 'faqs_7_question', 'Do you colormatch?'),
(3755, 840, '_faqs_7_question', 'field_5a423f3f54585'),
(3756, 840, 'faqs_7_answer', 'Yes, please refer to the Pantone Matching System (PMS) solid to process book. We can also match color samples. Color matching costs $25 per color. Color matching can be a lengthy process, please be aware of this when placing an order.'),
(3757, 840, '_faqs_7_answer', 'field_5a423f2454584'),
(3758, 840, 'faqs_8_question', 'How do i apply for terms?'),
(3759, 840, '_faqs_8_question', 'field_5a423f3f54585'),
(3760, 840, 'faqs_8_answer', 'Ask your CSR for an application or <a title="FGS Credit Application" href="http://fgs2.com/wp-content/uploads/2014/12/FGS-CREDIT-APPLICATION-.pdf" target="_blank" rel="noopener">download here</a>, upon receipt please fill out application and provide the necessary information.  Send completed application back to CSR and your application will be reviewed.'),
(3761, 840, '_faqs_8_answer', 'field_5a423f2454584'),
(3762, 840, 'faqs_9_question', 'What payment methods does fgs accept?'),
(3763, 840, '_faqs_9_question', 'field_5a423f3f54585'),
