(4195, 896, 'description', '<ul>\r\n 	<li>Corrugated Plastic is used for single use to short-term applications. It can be routed into custom shapes to meet your needs. It is typically direct printed and can be installed into signacades for sidewalk sign applications or stepstakes for road side applications.</li>\r\n 	<li>Technical Specs:  Type: Long-flutes, Short-flutes(Call for availability); Color: Readily available: White; Call for availability: Black, Yellow, Blue, Green, Natural, Granby Blue, JM Gray, Brown, Ivory, Orange, Red, Navy, Silver, Purple; Size: 48″ x 96″, 60″ x 120″(call for availability); Thickness: Readily available: 1/8″ (3 mil); Call for availability: 1/4″ (6 mil), 1/2″ (10 mil)</li>\r\n 	<li>Applications: Outdoor Signage, Event Signage</li>\r\n 	<li>Products: Sidewalk Signs, Standees, Golf Tournament Signs, Political Signs</li>\r\n</ul>'),
