(4225, 903, 'description', '<ul>\r\n 	<li>Polycarbonate, also know as Lexan, is similar to acrylic with one exception it is able to be direct printed. Polycarbonate is used when the final product is going into a frame or when polished edges is not needed. It is an ideal substrate for backlit signs because of its impact resistant properties. When paired with white ink and it can be routed into custom shapes to fit your application.</li>\r\n 	<li>Technical Specs: Type: Standard, Non-glare, White(Milk); Size: 48″ x 96″, 60″ x 120″(call for availability); Thickness: 010, 020, 1/16″, 1/8″, 3/16″, 1/4″, 1/2″</li>\r\n 	<li>Applications: Architectural, Interior Design, Fine Art Reproduction, POP/POS, Theme Park, Exhibit &amp; Displays</li>\r\n 	<li>Products: Wall Graphics, Backlit Signs, Dimensional Signs</li>\r\n</ul>'),
