(4271, 915, 'description', '<ul>\r\n 	<li>We have a wide selection of fabrics to suit your every need. We can print using dye sublimation, latex, or UV direct print onto our fabrics depending on your specifications.</li>\r\n 	<li>Technical Specs: Size: Widths vary depending on material; Type: Blockout, Heavy Knit, Polyduck, Power Stretch, Removable Adhesive Fabric, Satin, Spandex, Tri Poplin, Triple White, Waterfall</li>\r\n 	<li>Applications: Architectural, Interior Design, Outdoor Signage, Fine Art Reproduction, POP/POS, Theme Park, Exhibit &amp; Displays, Storefront Signage</li>\r\n 	<li>Products: Backlit Signs, Banners, Flags, Retractable Banners, Tradeshow Flags, Hanging Exhibit Graphics, Heat Transfer Graphics, Pop Up Tents</li>\r\n</ul>'),
