(140, 6, '2017-12-25 15:56:48', '2017-12-25 15:56:48', 'Florida Graphic Services is a wholesale large format printing company. Our services include, but are not limited to, graphic design, color correction, prepress, digital print production, finishing, kit-packing, fulfillment and shipping. Located in Clearwater, Florida, our 30,000 square foot climate controlled production facility contains the most advanced printing and finishing technologies available. Our most important asset is the fine people that make up our team of employees. We continually invest in training and retaining the most professional, knowledgeable and friendly staff in the industry. At FGS, there is nothing more important to our long term success than further developing and enhancing the trust and relationships we build with our customers. We take great pride in creating the finest print products available at competitive pricing, together with unsurpassed service. We really do appreciate the opportunity to earn your business.', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2018-01-11 09:35:00', '2018-01-11 09:35:00', '', 0, 'http://do.ready-for-feedback.com/561-media/fgs/?page_id=140', 0, 'page', '', 0),
