(834, 6, '2018-01-11 09:34:22', '2018-01-11 09:34:22', 'Florida Graphic Services is a wholesale large format printing company. Our services include, but are not limited to, graphic design, color correction, prepress, digital print production, finishing, kit-packing, fulfillment and shipping. Located in Clearwater, Florida, our 30,000 square foot climate controlled production facility contains the most advanced printing and finishing technologies available. Our most important asset is the fine people that make up our team of employees. We continually invest in training and retaining the most professional, knowledgeable and friendly staff in the industry. At FGS, there is nothing more important to our long term success than further developing and enhancing the trust and relationships we build with our customers. We take great pride in creating the finest print products available at competitive pricing, together with unsurpassed service. We really do appreciate the opportunity to earn your business.', 'About Us', '', 'inherit', 'closed', 'closed', '', '140-revision-v1', '', '', '2018-01-11 09:34:22', '2018-01-11 09:34:22', '', 140, 'http://do.ready-for-feedback.com/561-media/fgs/140-revision-v1/', 0, 'revision', '', 0),
